import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

import './App.css'

function Map() {

    const [user, setUser] = useState(null);

    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/login');
        } else {
            axios.get('/api/auth/verify', { headers: { authorization: token } })
                .then(response => {
                    if (response.status !== 200) {
                        navigate('/login');
                    } else {
                        setUser(response.data.user); // Imposta l'utente
                    }
                })
                .catch((error) => {
                    console.error('Verification error:', error);
                    navigate('/login');
                });
        }
    }, [navigate]);

    if(!user){
        return <div>Caricamento in corso...</div>
    }

    return (
        // <div classnName="Dashboard container">
        //     <div className="row justify-content-center">

        //         <div className="btn-group btn-group-lg" role="group" aria-label="Basic example">
        //             <img className="col-1 btn btn-primary" src="/assets/img/logo.png"></img>
        //             <a href="#" className="col-7 btn btn-primary">Home</a>
        //             <select name="Category" value="category" className="col-7 btn btn-primary">Categoria</select>
        //             <a hreg="#" className="col-7 btn btn-primary">Chat</a>
        //             <a hreg="#" className="col-7 btn btn-primary">Profilo</a>
        //         </div>
        //     </div>
        // </div>

        <div className="Map">

            <nav className="navbar navbar-expand-lg bg-success shadow-lg fixed-top">

                <div className="container-fluid">
                    <a className="navbar-brand text-white" href="/homepage">
                        <img src="assets/img/logoNuovo.png" alt="Eventi Logo" className="d-inline-block align-text-top" style={{ width: '50px', height: '50px' }} />
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"> </span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link text-white" aria-current="page" href="/homepage">Home</a>
                            </li>

                            <li className="nav-item dropdown">
                                <a className="nav-link dropdown-toggle text-white" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    Categorie
                                </a>
                                <ul className="dropdown-menu text-white">
                                    <li><a className="dropdown-item" href="/categorie/cultura">Cultura</a></li>
                                    <li><a className="dropdown-item" href="/categorie/concerti">Concerti</a></li>
                                    {/* <li><hr className="dropdown-divider" /></li> */}
                                    <li><a className="dropdown-item" href="/categorie/mostre">Mostre</a></li>
                                    <li><a className="dropdown-item" href="/categorie/party">Party</a></li>
                                    <li><a className="dropdown-item" href="/categorie/sport">Sport</a></li>
                                </ul>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link active text-white" href="/mappa">Mappa</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link text-white" href="/chat">Chat</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link text-white" href="/profilo">Profilo</a>
                            </li>

                            <li className="nav-item">
                                <a className={`nav-link ${user && user.organizer ? 'text-white' : 'disabled'}`} href={`${user && user.organizer ? '/organizzatore' : ''}`} aria-disabled={user && !user.organizer}>Organizzatore</a>
                            </li>
                        </ul>
                        <form className="d-flex" role="search">
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-outline-light" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>

            {/* ------------------------------------ SPAZIO SU --------------------------------------------- */}

            <div className="m-5 p-2">
                <div></div>
            </div>

            {/* ------------------------------------ MAPPA --------------------------------------------- */}

            <section className="pt-4">
                <div className="container px-lg-5">
                    <div className="row p-5 p-lg-5 gx-lg-5">
                        <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d12660.047486303667!2d15.078201365254122!3d37.50763815313888!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sit!2sit!4v1722606557203!5m2!1sit!2sit" width="800" height="600" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
                    </div>
                </div>
            </section>



        </div>


    );
}

export default Map;
